Los representantes de @VisitFlorida estuvieron en #DallasTX promocionando varios de sus destinos turísticos en un lunch donde reunieron a #travelbloggers y #travelwriters y es que Dallas es el 6to. proveedor de visitantes hacia el estado del sol. 

Gracias Visit Florida por la invitación y no puedo esperar viajar a The Florida Keys, Pensacola y Tampa entre otras ciudades. 

