Siempre había querido montarme en una de las góndolas en #LasColinas. Este fin de semana durante #STEIrving nos sorprendió @visitirvingtx con este fabuloso paseo. 

Realmente tiene toda la vibra de estar en Venecia pero es aquí mismo en #IrvingTX. Es para ocasiones especiales, celebraciones o para celebrar la vida. 

@gondolaadventures y puedes ir a su web para ver precios o hacer reservaciones. 

📍357 West Fork, Irving, TX 75039. 

