Amigas in Business @weallgrowlatina x @capitalone estuvo en #AustinTX. 

Charlas, paneles, networking, workbooks y comida latina deliciosa junto con mujeres de negocios.

Nos fuimos desde #DallasTX y fue divino reencontrarnos con amigas queridas y conocer a otras mujeres que buscan cambiar el mundo con sus marcas, con sus testimonios y mensajes de éxito.

Muy emotivo oír a las empresarias de #Texas que recibieron grants, todas de #DFW 👏🏽 @cadenacollective ($15,000) @thesocialchica ($10,000 sanaraskincare ($5,000)

Fue un placer finalmente conocer a Vanessa Santos @vanessasantosfein Co-CEO de #WeAllGrow Latina @weallgrowlatina. Habló sobre la vulnerabilidad, sobre The Ripple Effect y el mundo corporativo. ¡Nos encantó su ponencia!

